VALUES ('3160791637773', 'Les Tartelettes Raffinées', 'Farine de _blé_, _beurre_ pâtissier 9.5% (équivalent _beurre_ reconstitué 11.4%), boudin noir 9.3% [viande de porc, gras de porc, glace, sang de porc en poudre, épices et plantes aromatiques (oignon, poivre, piments, coriandre, cumin, muscade, cannelle, ail, girofle), sel, _lait_ en poudre, protéines de _lait_, arômes naturels], figue 7.9%, fève pelée 7%, oignon préfrit 6.9% (oignon, huile de tournesol), _noix de saint-jacques_* sans corail 5.8%, bloc de foie gras de canard 4.9% (foie gras de canard, eau, armagnac, sel, sucre, poivre, antioxydant : ascorbate de sodium, conservateur : e250), poivron rouge grillé 4.7% (poivron rouge, huile detournesol), poivron jaune grillé (poivron jaune, huile de tournesol), _crevette_ décortiquée cuite pandalus borealis 4.6%,compote de pommes 4.6% (purée de pommes concentrée, sirop de glucose-fructose, antioxydant : acide ascorbique), farine de seigle complet, _œuf_, _crème_ 2.7% (_crème_, stabilisant : carraghénanes, émulsifiant : e472b), huile d\'olive, purée de figues sucrée 1.4% (figue, sucre, acidifiant : acide citrique, antioxydant : acide ascorbique), farine d\'_orge_ complète, sucre, vinaigre de xérès 0.8%, _lactosérum_, sel, arôme naturel _poisson_ (contient _blé_, _poisson_ et _crustacés_), poudres à lever : carbonate acide de sodium diphosphate disodique, préparation déshydratée pour sauce type béchamel (_lactosérum_, amidon modifié, matière grasse végétale, amidon de _blé_, _lait_ écrémé en poudre, sirop de glucose, épaississant : alginate de sodium, épices, arômes naturels),protéines de lait, chapelure (contient blé), épices (paprika, poivres, coriandre, piment), thym. *noix de saint-jacques : espèce zygochlamys patagonica, origine argentine.', 'https://static.openfoodfacts.org/images/products/316/079/163/7773/front_fr.10.400.jpg', '19.3', '6.5', '30.7', '3.2', '', '8.3', '0.68', '0.267716535433071', '', '1');

